    value: The committee does not use any national party transfers to fund Federal
      Election Activity.  The party utilizes a strict accounting method to ensure
      that national party transfers are being used only for permissible administrative
      and overhead expenses.  This accounting method also guarantees that all Federal
      Election Activity is being funded by contributions raised under the limitations
      and prohibitions of the Federal Election Campaign Act
  - name: AMENDED CD
    number: '5'
    value: ' as amended.    The funds reported on Schedule B supporting line 22 were
      not in any way used in connection with any federal election'
  - value: ' or any federal candidate'
  - value: ' or any activities that qualify as Federal Election Activity.  Rather
      these transferred funds were utilized solely in connection with state and non-federal
      candidates and activities.    The committee maintains a separate Levin account
      which was established solely for the receipt of Levin funds for Federal Election
      Activity according to 11 CFR 300.30.    The payments to individuals for office
      cleaning and computer consulting reported on H4 are not employees of the committee
      and therefore are not subject to 11 CFR 300.33(c)(2).    The phrase Voter registration
      table in the purpose field on H4 is generic in nature and does not support any
      federal candidate or any other Federal Election Activity.  The individuals who
      maintain these tables are not employees of the committee and therefore not subject
      to 11 CFR 300.33(c)(2).    There are no wages reported on Schedule B supporting
      Line 30(b) or H4 because there are currently no employees who are providing
      services for any Federal Election Activity or in connection with a federal election
      or any federal candidates.'
